
import React, { useRef, useEffect } from 'react';
import * as THREE from 'three';
import { gsap } from 'gsap';

// Base64 encoded image data for the AI graphic. This makes the component self-contained.
const imageUrl = 'data:image/jpeg;base64,-..';

const App: React.FC = () => {
    const mountRef = useRef<HTMLDivElement>(null);
    const rendererRef = useRef<THREE.WebGLRenderer | null>(null);
    const sceneRef = useRef<THREE.Scene | null>(null);
    const cameraRef = useRef<THREE.PerspectiveCamera | null>(null);
    const pointerRef = useRef(new THREE.Vector2());
    const raycasterRef = useRef(new THREE.Raycaster());
    const interactiveObjects = useRef<THREE.Object3D[]>([]);

    useEffect(() => {
        if (!mountRef.current) return;

        const currentMount = mountRef.current;

        // Scene
        const scene = new THREE.Scene();
        sceneRef.current = scene;
        
        // Camera
        const camera = new THREE.PerspectiveCamera(75, currentMount.clientWidth / currentMount.clientHeight, 0.1, 1000);
        camera.position.z = 30;
        cameraRef.current = camera;

        // Renderer
        const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });
        renderer.setSize(currentMount.clientWidth, currentMount.clientHeight);
        renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
        currentMount.appendChild(renderer.domElement);
        rendererRef.current = renderer;
        
        // Lighting
        const ambientLight = new THREE.AmbientLight(0xffffff, 0.7);
        scene.add(ambientLight);
        const directionalLight = new THREE.DirectionalLight(0xffffff, 0.8);
        directionalLight.position.set(5, 10, 7);
        scene.add(directionalLight);

        // Layers
        const layers: { obj: THREE.Mesh | THREE.Points, data: any }[] = [];
        const textureLoader = new THREE.TextureLoader();
        const mainTexture = textureLoader.load(imageUrl);
        mainTexture.anisotropy = renderer.capabilities.getMaxAnisotropy();

        const layerData = [
            { id: 'background', z: -35, scale: 65, darkness: 0.4 },
            { id: 'stage', z: 0, scale: 40, darkness: 0 },
        ];

        layerData.forEach(data => {
            const geometry = new THREE.PlaneGeometry(1, 1);
            const material = new THREE.MeshBasicMaterial({ 
                map: mainTexture, 
                transparent: true,
                color: new THREE.Color().setScalar(1 - data.darkness)
            });
            const plane = new THREE.Mesh(geometry, material);
            
            const aspect = 1; // image aspect ratio
            plane.scale.set(data.scale * aspect, data.scale, 1);
            plane.position.z = data.z;
            
            scene.add(plane);
            layers.push({ obj: plane, data });

            if (data.id === 'stage') {
                interactiveObjects.current.push(plane);
            }
        });

        // Particles
        const createParticles = (count: number, size: number, zPosition: number, speedFactor: number) => {
            const particlesGeometry = new THREE.BufferGeometry();
            const positions = new Float32Array(count * 3);
            for (let i = 0; i < count * 3; i++) {
                positions[i] = (Math.random() - 0.5) * 150;
            }
            particlesGeometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));
            const particlesMaterial = new THREE.PointsMaterial({
                size: size,
                color: 0xaaaaee,
                transparent: true,
                blending: THREE.AdditiveBlending,
                depthWrite: false,
                sizeAttenuation: true,
            });
            const particles = new THREE.Points(particlesGeometry, particlesMaterial);
            particles.position.z = zPosition;
            scene.add(particles);
            return { obj: particles, data: { z: zPosition, speedFactor } };
        };

        const bgParticles = createParticles(8000, 0.08, -50, 0.01);
        const fgParticles = createParticles(2000, 0.15, 20, 0.08);
        layers.push(bgParticles, fgParticles);


        // Mouse/Touch movement
        const onPointerMove = (event: PointerEvent) => {
            const x = (event.type === 'touchmove') ? (event as unknown as TouchEvent).touches[0].clientX : event.clientX;
            const y = (event.type === 'touchmove') ? (event as unknown as TouchEvent).touches[0].clientY : event.clientY;
            
            pointerRef.current.x = (x / window.innerWidth) * 2 - 1;
            pointerRef.current.y = -(y / window.innerHeight) * 2 + 1;
        };
        window.addEventListener('pointermove', onPointerMove);
        
        // Handle Click for interactivity
        const onClick = (event: MouseEvent) => {
            if (!cameraRef.current || !sceneRef.current) return;
            raycasterRef.current.setFromCamera(pointerRef.current, cameraRef.current);
            const intersects = raycasterRef.current.intersectObjects(interactiveObjects.current);

            if (intersects.length > 0) {
                const target = intersects[0].object;
                 gsap.to(target.scale, {
                    duration: 0.2,
                    x: target.scale.x * 1.05,
                    y: target.scale.y * 1.05,
                    ease: 'power2.out',
                    yoyo: true,
                    repeat: 1,
                });
            }
        };
        window.addEventListener('click', onClick);


        // Handle Resize
        const onResize = () => {
            if (cameraRef.current && rendererRef.current) {
                cameraRef.current.aspect = currentMount.clientWidth / currentMount.clientHeight;
                cameraRef.current.updateProjectionMatrix();
                rendererRef.current.setSize(currentMount.clientWidth, currentMount.clientHeight);
                rendererRef.current.setPixelRatio(Math.min(window.devicePixelRatio, 2));
            }
        };
        window.addEventListener('resize', onResize);

        // Entrance Animation
        layers.forEach(({ obj }) => {
            gsap.from(obj.scale, { x: 0, y: 0, duration: 1.5, ease: 'power3.out', delay: 0.2 });
        });
        gsap.from(camera.position, { z: 80, duration: 2, ease: 'power3.out' });
        
        // Animation loop
        const clock = new THREE.Clock();
        const animate = () => {
            requestAnimationFrame(animate);

            const elapsedTime = clock.getElapsedTime();

            // Parallax effect
            layers.forEach(({ obj, data }) => {
                const moveFactor = data.z * 0.1;
                gsap.to(obj.position, {
                    duration: 1,
                    x: pointerRef.current.x * moveFactor,
                    y: pointerRef.current.y * moveFactor,
                    ease: 'power2.out',
                });
            });

            // Tilt effect
            if (cameraRef.current) {
                 gsap.to(cameraRef.current.rotation, {
                    duration: 1,
                    y: pointerRef.current.x * 0.1,
                    x: -pointerRef.current.y * 0.1,
                    ease: 'power2.out',
                });
            }
            
            // Animate particles
            (fgParticles.obj.geometry as THREE.BufferGeometry).attributes.position.needsUpdate = true;
            fgParticles.obj.rotation.y = elapsedTime * 0.05 * fgParticles.data.speedFactor;
             (bgParticles.obj.geometry as THREE.BufferGeometry).attributes.position.needsUpdate = true;
            bgParticles.obj.rotation.y = elapsedTime * 0.02 * bgParticles.data.speedFactor;


            if (rendererRef.current && sceneRef.current && cameraRef.current) {
                rendererRef.current.render(sceneRef.current, cameraRef.current);
            }
        };

        animate();

        // Cleanup
        return () => {
            window.removeEventListener('pointermove', onPointerMove);
            window.removeEventListener('resize', onResize);
            window.removeEventListener('click', onClick);

            if(rendererRef.current?.domElement.parentNode === currentMount) {
                currentMount.removeChild(rendererRef.current.domElement);
            }

            // Dispose Three.js objects
            scene.traverse(object => {
                if (object instanceof THREE.Mesh) {
                    if (object.geometry) {
                        object.geometry.dispose();
                    }
                    if (Array.isArray(object.material)) {
                        object.material.forEach(material => {
                            if (material.map) material.map.dispose();
                            material.dispose();
                        });
                    } else if (object.material) {
                        if (object.material.map) object.material.map.dispose();
                        object.material.dispose();
                    }
                } else if (object instanceof THREE.Points) {
                     if (object.geometry) object.geometry.dispose();
                     if (object.material) {
                        if(Array.isArray(object.material)) {
                            object.material.forEach(m => m.dispose());
                        } else {
                            object.material.dispose();
                        }
                     }
                }
            });
            mainTexture.dispose();
            renderer.dispose();
        };
    }, []);

    return (
        <div className="relative w-screen h-screen overflow-hidden cursor-move">
            <div ref={mountRef} className="absolute inset-0 w-full h-full" />
             <div className="absolute top-4 left-4 text-white text-2xl font-black uppercase tracking-widest pointer-events-none" style={{ textShadow: '0 0 10px rgba(0,0,0,0.7)' }}>
                AI Code Engine
            </div>
            <div className="absolute bottom-4 right-4 text-white text-sm bg-black bg-opacity-50 px-3 py-1 rounded-md pointer-events-none">
                Move mouse/finger to explore. Click the center.
            </div>
        </div>
    );
};

export default App;
